import "./index.css";

const ProductCard = (props) => {
  const { productDetails } = props;
  const { title, brand, price, imageUrl, ratings } = productDetails;

  return (
    <li>
      <img src={imageUrl} alt={title} className="productImage" />
      <p>{title}</p>
      <p>{brand}</p>
      <p>{price}</p>
      <p>{ratings}</p>
    </li>
  );
};

export default ProductCard;
